import React from 'react';
//import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const Dashboard = () => {
  return (
    <div>
        <h2>Dashboard</h2>
        <div className="dashboard-container">
          <div className="dashboard-card">
            <h2>Electric Bills</h2>
            <p>Electric Bills</p>
          </div>
          <div className="dashboard-card">
            <h2>Water Bill</h2>
            <p>Water Bill</p>
          </div>
          <div className="dashboard-card">
            <h2>Internet Bill</h2>
            <p>Internet Bill</p>
          </div>
        </div>
      </div>
  );
};

export default Dashboard;
